    { name: 'home', label: 'Home' ,link:'http://localhost:3000/'},
    { name: 'n-and-ad', label: 'Notification & Advisory' ,link:'https://www.computerhope.com/issues/ch000074.htm'},
    { name: 'trade-indicators', label: 'Trade Indicators',link:'https://www.computerhope.com/issues/ch000074.htm' },
