    { name: 'non-tariff-measures', label: 'Non-Tariff Measures' ,link:'https://www.computerhope.com/issues/ch000074.htm'},
    { name: 'commodity-wise-analysis', label: 'Commodity-wise Analysis',link:'https://www.computerhope.com/issues/ch000074.htm' },
    { name: 'case studies', label: 'Case Studies' ,link:'https://www.computerhope.com/issues/ch000074.htm'},]

function App() {
  return (
      <div className='Home-Page'>
        <Sidebar items={items}/>
        <div className="page">
          <Header/>
        </div>
      </div>
  );
}

export default App;
